.center-middle {
  position: absolute;
  left: 50%;
  top: 50%;
  transform: translate(-50%, -50%);
}

.split-pane-page-wrapper {
  height: 600px;
  .pane {
    width: 100%;
    height: 100%;
    &.left-pane {
      background: sandybrown;
    }
    &.right-pane {
      background: palevioletred;
    }
    &.top-pane {
      background: sandybrown;
    }
    &.bottom-pane {
      background: palevioletred;
    }
  }
  .custom-trigger {
    width: 20px;
    height: 20px;
    border-radius: 50%;
    background: #000000;
    position: absolute;
    .center-middle;
    box-shadow: 0 0 6px 0 rgba(28, 36, 56, 0.4);
    i.trigger-icon {
      .center-middle;
    }
  }
}
